def make_data_frame(overall_weight, langs1):
    overall_weight = [[float(w) for w in weight.split()] for weight in overall_weight.strip().split("\n")]

    langs = "ar-es	ar-fr	ar-he	ar-it	ar-ja	ar-ko	ar-pt	ar-ru	ar-tr	es-ar	es-fr	es-he	es-it	es-ja	es-ko	es-pt	es-ru	es-tr	fr-ar	fr-es	fr-he	fr-it	fr-ja	fr-ko	fr-pt	fr-ru	fr-tr	he-ar	he-es	he-fr	he-it	he-ja	he-ko	he-pt	he-ru	he-tr	it-ar	it-es	it-fr	it-he	it-ja	it-ko	it-pt	it-ru	it-tr	ja-ar	ja-es	ja-fr	ja-he	ja-it	ja-ko	ja-pt	ja-ru	ja-tr	ko-ar	ko-es	ko-fr	ko-he	ko-it	ko-ja	ko-pt	ko-ru	ko-tr	pt-ar	pt-es	pt-fr	pt-he	pt-it	pt-ja	pt-ko	pt-ru	pt-tr	ru-ar	ru-es	ru-fr	ru-he	ru-it	ru-ja	ru-ko	ru-pt	ru-tr	tr-ar	tr-es	tr-fr	tr-he	tr-it	tr-ja	tr-ko	tr-pt	tr-ru".split()
    langs1 = [k.split(',') for k in langs1]
    langs1 = [item for sublist in langs1 for item in sublist]

    indexes = sorted(range(len(langs1)), key=lambda idx: langs1[idx])
    langs2 = sorted(langs, key=lambda l: indexes[langs.index(l)])

    overall_weight = [sorted(zip(langs, overall_weight_i), key=lambda l: indexes[langs.index(l[0])]) for
                      overall_weight_i in overall_weight]

    overall_weight = sorted(zip(langs, overall_weight), key=lambda l: indexes[langs.index(l[0])])
    langs = sorted(langs, key=lambda l: indexes[langs.index(l)])

    for i in range(len(overall_weight)):
        overall_weight[i] = overall_weight[i][1]
        for j in range(len(overall_weight[i])):
            overall_weight[i][j] = overall_weight[i][j][1]
    df = pd.DataFrame(overall_weight, columns=langs)
    df.index = langs
    return df


def draw_overall(weight, name, m, n):
    weight = make_data_frame(overall_weight, langs1="ja-ru ar-es he-tr,ja-tr pt-fr,tr-fr ru-tr,it-tr he-ja,ar-ja ko-he,tr-he ru-ar,fr-ar he-es,ja-es,it-es tr-ru,he-ru,es-ru es-it,ru-it,ja-it pt-he,ru-he,ja-he,it-he es-fr,he-fr,ru-fr ja-ar,tr-ar,ko-ar tr-pt,ja-pt,fr-pt,he-pt he-ko,ru-ko,ja-ko es-he,ar-he,fr-he pt-es,ru-es,ko-es,tr-es,fr-es es-ar,he-ar,it-ar,pt-ar it-fr,ko-fr,ar-fr,ja-fr pt-ru,ko-ru,fr-ru,it-ru,ar-ru es-tr,pt-tr,ko-tr,fr-tr,ar-tr it-ko,tr-ko,ar-ko,fr-ko,es-ko,pt-ko ru-pt,it-pt,es-pt,ar-pt,ko-pt pt-ja,es-ja,tr-ja,ru-ja,fr-ja,ko-ja,it-ja he-it,ko-it,tr-it,fr-it,ar-it,pt-it".split())
    plot = sns.heatmap(weight, cmap='GnBu', vmax=m, vmin=n)
    plot.set_xlabel('Task of Interests', labelpad=8)
    plot.set_ylabel('Auxiliary Tasks', labelpad=3)
    plot.xaxis.set_ticks_position('top')
    plot.yaxis.set_ticks_position('left')
    plot.xaxis.set_label_position('top')
    # plt.show()
    plt.savefig(name)


